import * as React from 'react'
import './App.css';
import GrabStatBlock from "./components/player_statblock"

function App() {

  return (
    <div className="App">



      <div className='player_input_area'>
        <div className='player_story_board'>This is where the players put what they want to happen</div>
        <textarea className='player_text_input' cols={30} rows={10}></textarea>
      </div>


      <div className='dm_input_area'>
        <div className='dm_story_board'>This is where the DM creates the actually story based off the Rolls and Player's Want's</div>
        <textarea className='dm_text_input' cols={30} rows={10}></textarea>
      </div>

      <div className='bottom_section'>
        <div className='players_statblock'>
          <GrabStatBlock/>
        </div>

      </div>

    </div>
  );

}


export default App;
